  \"2015-05-06T23:05:37.337750\",\n\t\"name\": \"lat-background-models\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Galactic model is a spatial and spectral
  template. The model for the Galactic diffuse emission was developed using spectral
  line surveys of HI and CO (as a tracer of H2) to derive the distribution of interstellar
  gas in Galactocentric rings. Infrared tracers of dust column density were used to
  correct column densities in directions where the optical depth of HI was either
  over or under-estimated. The model of the diffuse gamma-ray emission was then constructed
  by fitting the gamma-ray emissivities of the rings in several energy bands to the
  LAT observations. \",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
